import React from 'react';

import styles from './Logo.module.css';
import classNames from '../../utils/classNames';
import { AllElementPropsWithoutRef } from '../../utils/elementTypings';

export const logoFi =
  'data:image/svg+xml;base64,';

export const logoFiDark =
  'data:image/svg+xml;base64,';

export const logoSv =
  'data:image/svg+xml;base64,';

export const logoSvDark =
  'data:image/svg+xml;base64,';

export const logoRu =
  'data:image/svg+xml;base64,';

export const logoRuDark =
  'data:image/svg+xml;base64,';

export enum LogoSize {
  Full = 'full',
  Small = 'small',
  Medium = 'medium',
  Large = 'large',
}

interface LogoHidden {
  /**
   * Aria hidden property
   */
  'aria-hidden': true;
  /**
   * Alt text to apply to the logo
   */
  alt?: never | '';
}

interface LogoShown {
  /**
   * Aria hidden property
   */
  'aria-hidden'?: false;
  /**
   * Alt text to apply to the logo
   */
  alt: string;
}

type LogoHiddenOrShown = LogoHidden | LogoShown;

export type LogoProps = AllElementPropsWithoutRef<'img'> &
  LogoHiddenOrShown & {
    /**
     * Additional class names to apply to the logo
     */
    className?: string;
    /**
     * The size of the logo
     * @default 'full'
     */
    size?: LogoSize;
    /**
     * Src of the logo. Data-url, locally imported image or a URL
     */
    src: HTMLImageElement['src'];
    /**
     * Title for the logo
     */
    title?: string;
    /**
     * Override or extend the styles applied to the component
     */
    style?: React.CSSProperties;
  };

export const Logo = ({ alt, className, size = LogoSize.Full, style, ...rest }: LogoProps) => {
  const props = {
    ...rest,
    alt,
    size,
    className: classNames(styles.logo, size !== LogoSize.Full && styles[size], className),
    style,
  };

  return <img alt={alt} {...props} />;
};
